      if (panzoomEnabled) {
        const elementRef = SRLElementPanzoomRef.current
        if (elementRef !== null || elementRef !== undefined) {
          elementRef.classList.add('panzoom-enabled')
        }
        const panzoomElement = panzoom(elementRef, {
          bounds: true,
          boundsPadding: 0.6,
          maxZoom: 3,
          minZoom: 1
